       uint foo;
       string text;       
   }

   mapping(address=>MyStruct) myStructs;

   function examples() external {
    myStructs[msg.sender] = MyStruct({foo:123,text:"hello"});
    MyStruct storage myStruct = myStructs[msg.sender];
    myStruct.text ="no hello";
   }


}

